commit_message:
Fix rally task start output format 

The old output:
    args values:
    OrderedDict([(u'runner', OrderedDict([(u'type', u'constant')...

This patch makes output like:
     args values:
     {
       "runner": {
         "type": "constant",
         "concurrency": 10,
         "times": 100
       },
       "args": {
         "name_length": 10
       }
     }
Change-Id: Ifbc3c110994974321bcccd767f836aaa6d02ef07
Closes-Bug: #1435294

